import React from 'react'
import articles from './articlecontent'

const ArticlesList = () => {
    <>
        const article = articles.map(article => (
            <div>
                <h1>{article.title}</h1>
                <p>{article.content}</p>
            </div>
        ))
    </>
}

export default ArticlesList
